issue.body:
**Description**
I built **onnxruntime** from source following [these](https://onnxruntime.ai/docs/build/inferencing.html#cpu) instructions.
Getting `error: Ort::g_api should have been declared inside Ort` when trying to _include_ **onnxruntime_cxx_api.h** in a simple `hello_world.cpp` code.

**System information**
- OS Platform and Distribution: **WSL 2.0** _Ubuntu 20.04.3 LTS on Windows 10 x86_64_
- ONNX Runtime installed from (source or binary): source (using the link mentioned above)
- G++ Compiler version: 9.3.0

**To Reproduce**
When I compile the following piece of code with `g++ -o run1 imp_onnx.cpp -I/home/abilashravi/trials/onnx_in_c/onnxruntime/include/onnxruntime/core/session`
```
// imp_onnx.cpp
#include <iostream>
#include <onnxruntime_cxx_api.h>

int main()
{
	std::cout << "Hello world.!";
	return 0;
}
```
I get this
![g++ er1](https://user-images.githubusercontent.com/53215532/149608263-b2b064ff-e5eb-485e-b69c-30644c2d3cfc.JPG)


I tried to fix it based on discussions [here](https://github.com/microsoft/onnxruntime/issues/2081) by adding `const OrtApi* Ort::g_api = OrtGetApi(ORT_API_VERSION);` to the code. But when I compile the following
```
// imp_onnx.cpp
#include <iostream>
#include <onnxruntime_cxx_api.h>

const OrtApi* Ort::g_api = OrtGetApi(ORT_API_VERSION);

int main()
{
	std::cout << "Hello world.!";
	return 0;
}
```
I'm getting this
![g++ er2](https://user-images.githubusercontent.com/53215532/149608545-e3ce26f8-6ec6-456f-8ad3-3510c3d84303.JPG)

Any suggestion would be helpful.!
